    Health Act of 1977 and the Occupational Safety and Health Act of 1970, provides
    a testing approval and certification program assuring commercial availability of
    safe personal protective devices. NIOSH develops improved performance regulations,
    tests and certifies (or approves) devices, and purchases approved and certified
